// *******Child Components*******
import MainContent from "./Components/MainContent";
import SideNav from "./Components/SideNav";

// *******Style Sheet*******
import "./App.css";

export class App extends Component {
  render() {
    return (
      <div>
        <SideNav />
        <MainContent />
      </div>
    );
  }
}

export default App;
